import Link from 'next/link';

const myStyle = {
    color: "red",
    borderLeft: "5px solid black",
    padding: "5px"
}

const About = () => (
    <div>
        <h2>About page</h2>
        <Link href="/">
            <a style={myStyle}>Home page</a>
        </Link>
    </div>
);


export default About;
